import logo from '../../assets/imgs/bold.png';
import './Header.css';
import { Overlay } from 'react-overlay-component';
import { useState } from 'react';
import Backdrop from '../Overlay/Backdrop';

function Header() {
	const [showModal, setShowModal] = useState(false);

	const openModal = () => {
		setShowModal(prev => !prev);
	};

	return (
		<div className='Header'>
			<div className='header-brand'>
				<img className='header-logo' alt='logo' src={logo} />

				<h1 className='header-h1'> BiaNova </h1>
			</div>

			<div className='login'>
				<p>
					<button onClick={openModal} className='header-btn'>
						Log In
					</button>{' '}
					| <button className='header-btn'>Sign In</button>
				</p>
			</div>
			{/* <Backdrop showModal={showModal} setShowModal={setShowModal} /> */}
		</div>
	);
}

export default Header;
